//Pseudocode:
//  If error dari set point < batas toleransi
//      Hitung correction factor setiap x cycle nafas
//  else tampilin nilai asli

// Tunables
var cycle_limit = 5; //cek correction factor tiap berapa cycle?
var err_threshold = 90; //toleransi error dlm mililiter

// Global Vars
var set_vol = parseFloat(global.get("set_vol"));
var breath_count = parseInt(global.get("breath_count")) || 0;
var correction_factor = parseFloat(global.get("correction_factor")) || 1;
var vpeak = global.get("vpeak_val");
var last_cor = global.get("last_cor") || 1;


if( (parseInt(breath_count % cycle_limit) <= 0) || (breath_count < 3) ){
    global.set("vpeak_val_disp",vpeak*last_cor);
    if(Math.abs(set_vol - vpeak) < err_threshold ){
        correction_factor = set_vol / vpeak;    
    } else {
        correction_factor = 1;
    }
    global.set("correction_factor", correction_factor);

} else {
    if(Math.abs(set_vol - vpeak) < err_threshold ){
        global.set("vpeak_val_disp",vpeak*correction_factor);   
    } else {
        global.set("vpeak_val_disp",vpeak);
    }

}    

